import logo from './projects.png';
import './Home.css';



function Home() {

    return (
        <div className="App">
          <header className="App-header">

            <img src={logo} className="App-logo" alt="logo"/>
            <h3>
            Name: Aly Kourouma
              <br/>
             Message: Hey friends and family, welcome to my portfilo website. On this this website you will find answers about me, the projects I have created, and my contact information. Thank You for your time!

             <td></td>Directions: Go to the topto find out more about me!

            </h3>

          </header>
        </div>
      );
  }


export default Home;
